		$(function() {

				 var arr = [];
	                for(var i=0; i<pullMax; i++) {
	                    if(currentIndex < imgsdata.length) {
	                        arr.push(imgsdata[currentIndex]);
	                        currentIndex++;
	                    }
	                }
	                return arr;
			 }
			
			
			function initMasonry() {
				var newItemContainer = $('<div/>');
				$("#spinner").show();

				var imgs = getNewItems();
                for(i in imgs){
                    var img = imgs[i];
                    var clone = $('.tobeClone').clone().removeClass('tobeClone').addClass("thumbnail");
                    clone.find('.aimg').attr('href',img.lsrc).attr('data-lightbox',"lightbox_");
                    clone.find('.img').attr('src',img.lsrc);
                    newItemContainer.append(clone);
                    
                }
                var items = newItemContainer.find('.thumbnail');
                masNode.append(items);
                imagesLoading = true;
                items.imagesLoaded(function(){
                    imagesLoading = false;
                    items.css('opacity', 1);
                    masNode.masonry({
                        itemSelector: '.thumbnail',
                        isFitWidth: true
                    });
                    $("#spinner").hide();
                    appendToMasonry();
                });
			}
			
			
			function appendToMasonry() {
				if (currentIndex > 40) {return};
				var newItemContainer = $('<div/>');
				$("#spinner").show();
				var imgs = getNewItems();
			    if(imgs.length > 0){
			    	for(i in imgs){
	                    var img = imgs[i];
	                    var clone = $('.tobeClone').clone().removeClass('tobeClone').addClass("thumbnail");
	                    clone.find('.aimg').attr('href',img.lsrc).attr('data-lightbox',"lightbox_");
	                    clone.find('.img').attr('src',img.lsrc);
	                    newItemContainer.append(clone);
	                    
	                }
	                var items = newItemContainer.find('.thumbnail');
	                masNode.append(items);
	                imagesLoading = true;
	                items.imagesLoaded(function(){
	                    imagesLoading = false;
	                    items.css('opacity', 1);
	                    masNode.masonry('appended',  items);
	                    $("#spinner").hide();
	                    appendToMasonry();
	                }); 
				}
			}
			
			initMasonry();
			
		});
